Life at 7 - Episode 2 - ABC Australia

The Life at titles are part of an observational documentary series that chronicles the lives of eleven children as they grow from infancy to adolescence. Combining real life stories with cutting edge science, it offers a refreshing insight into contemporary family life. Every two years, the filmmakers revisit these children and their families to gain an in-depth snapshot of their lives, examining what it takes to give a child the best chance in life. Now, with our children having reached the critical age of seven, and in the midst of profound life changes, this two-part series explores their first tentative steps towards independence and self-identity. For the first time, in Life at 7, we hear directly from the children as they speak about who they are, and how they see themselves in their ever-expanding world.
